‼️Куди дніпрянам повідомляти про підозрілі мітки на дорогах та будівлях міста 

Ситуаційний центр Дніпра допомагає правоохоронним органам приймати звернення про спеціальні мітки, залишені на дорогах, будівлях та інших інфраструктурних об'єктах нашого міста для орієнтування ворожих ракет.

Якщо на вулицях міста ви помітили людей, які роблять певні нанесення, одразу повідомте про точну геолокацію, особливі прикмети людини і, за можливості,  напрямок її пересування.

Повідомити про підозрілі дії або нанесення міток можна: 

🔺за телефонами Ситуаційного центру Дніпра: 0673701336 та (067)370-12-64 (цілодобово), якщо за вказаною геолокацією є камери відеоспостереження, 
інформацію буде передано співробітникам поліції Ситуаційного центру;

🔺за допомогою спеціального чат-боту кіберполіції в Telegram @ukraine_avanger_bot, сфотографувати локацію і вона одразу потрапить до єдиної бази на Google Maps; 

🔺кіберполіції в Instagram @stop_russss та в Telegram @stoprus;

🔺поліції за номером 102. 

Ви також можете засипати подібні мітки землею або замалювати!

В Днепре увеличили финансирование теробороны

Во время 17-й внеочередной сессии горсовета было принято решение перераспределить городской бюджет. 

100 миллионов гривен перенаправлено из Департамента благоустройства и инфраструктуры на финансирование:
- Департамент благоустройства и инфраструктуры (ремонт дороги) - 5 млн гривен;
- Департамент транспортной инфраструктуры - 5 млн гривен;
- Департамент информационных технологий - 15 млн гривен; 
- Департамент соцполитики - 5 млн гривен;
- Департамент по местному самоуправлению, внутренней и информационной политике – 5 млн гривен;
- Департамент общественного порядка и гражданской защиты – 65 млн гривен.
